 data\n","\n","As previously described, for this project purposes we've used the movies_metadata.csv."]},{"cell_type":"code","execution_count":2,"id":"ab5781c4","metadata":{"execution":{"iopub.execute_input":"2024-03-25T21:39:35.193821Z","iopub.status.busy":"2024-03-25T21:39:35.160378Z","iopub.status.idle":"2024-03-25T21:39:37.090128Z","shell.execute_reply":"2024-03-25T21:39:37.088139Z"},"papermill":{"duration":1.945106,"end_time":"2024-03-25T21:39:37.092424","exception":false,"start_time":"2024-03-25T21:39:35.147318","status":"completed"},"tags":[]},"outputs":[],"source":["movie_dataset <- read.csv(\"/kaggle/input/the-movies-dataset/movies_metadata.csv\")"]},{"cell_type":"markdown","id":"2babf39d","metadata":{"papermill":{"duration":0.01088,"end_time":"2024-03-25T21:39:37.115031","exception":false,"start_time":"2024-03-25T21:39:37.104151","status":"completed"},"tags":[]},"source":["## Data cleaning\n","\n","Checking for missing values."]},{"cell_type":"code","execution_count":3,"id":"e75f294e","metadata":{"execution":{"iopub.execute_input":"2024-03-25T21:39:37.140428Z","iopub.status.busy":"2024-03-25T21:39:37.138785Z","iopub.status.idle":"2024-03-25T21:39:37.171742Z","shell.execute_reply":"2024-03-25T21:39:37.169898Z"},"papermill":{"duration":0.048456,"end_time":"2024-03-25T21:39:37.174273","exception":false,"start_time":"2024-03-25T21:39:37.125817","status":"completed"},"tags":[]},"outputs":[],"source":["missing_values <- sum(is.na(movie_dataset))\n","missing_values_by_column <- colSums(is.na(movie_dataset))"]},{"cell_type":"markdown","id":"5e98734b","metadata":{"papermill":{"duration":0.010938,"end_time":"2024-03-25T21:39:37.197757","exception":false,"start_time":"2024-03-25T21:39:37.186819","status":"completed"},"tags":[]},"source":["Removing 0, NA rows and duplicates"]},{"cell_type":"code","execution_count":4,"id":"1ed1cbc9","metadata":{"execution":{"iopub.execute_input":"2024-03-25T21:39:37.223013Z","iopub.status.busy":"2024-03-25T21:39:37.221402Z","iopub.status.idle":"2024-03-25T21:39:37.661107Z","shell.execute_reply":"2024-03-25T21:39:37.659277Z"},"papermill":{"duration":0.455176,"end_time":"2024-03-25T21:39:37.663679","exception":false,"start_time":"2024-03-25T21:39:37.208503","status":"completed"},"tags":[]},"outputs":[],"source":["movie_dataset[movie_dataset==\"[]\"] <- NA\n","movie_dataset<- na.omit(movie_dataset)\n","names(movie_dataset)[6]<- \"m_id\"\n","movie_dataset<-distinct(movie_dataset)"]},{"cell_type":"markdown","id":"52878b81","metadata":{"papermill":{"duration":0.010954,"end_time":"2024-03-25T21:39:37.685561","exception":false,"start_time":"2024-03-25T21:39:37.674607","status":"completed"},"tags":[]},"source":["Removing not needed columns, and leaving just the ones needed for this analysis and previewing the data."]},{"cell_type":"code","execution_count":5,"id":"7033adab","metadata":{"execution":{"iopub.execute_input":"2024-03-25T21:39:37.710924Z","iopub.status.busy":"2024-03-25T21:39:37.709305Z","iopub.status.idle":"2024-03-25T21:39:37.740177Z","shell.execute_reply":"2024-03-25T21:39:37.738282Z"},"papermill":{"duration":0.046255,"end_time":"2024-03-25T21:39:37.74261","exception":false,"start_time":"2024-03-25T21:39:37.696355","status":"completed"},"tags":[]},"outputs":[],"source":["movies <- subset(movie_dataset, select = -c(adult, belongs_to_collection, homepage, overview, poster_path, tagline, spoken_languages, status, video, production_countries))"]},{"cell_type":"markdown","id":"66ec981f","metadata":{"papermill":{"duration":0.010739,"end_time":"2024-03-25T21:39:37.764155","exception":false,"start_time":"2024-03-25T21:39:37.753416","status":"completed"},"tags":[]},"source":["Since some numeric data fields were stored as characters, we're changing it to numeric."]},{"cell_type":"code","execution_count":6,"id":"43df0e05","metadata":{"execution":{"iopub.execute_input":"2024-03-25T21:39:37.789253Z","iopub.status.busy":"2024-03-25T21:39:37.787672Z","iopub.status.idle":"2024-03-25T21:39:37.881977Z","shell.execute_reply":"2024-03-25T21:39:37.880084Z"},"papermill":{"duration":0.109646,"end_time":"2024-03-25T21:39:37.884465","exception":false,"start_time":"2024-03-25T21:39:37.774819","status":"completed"},"tags":[]},"outputs":[],"source":["movies$budget <- as.numeric(movies$budget)\n","movies$revenue <- as.numeric(movies$revenue)\n","movies$release_date <- as.Date(movies$release_date)"]},{"cell_type":"markdown","id":"2c34ac5a","metadata":{"papermill":{"duration":0.011038,"end_time":"2024-03-25T21:39:37.906421","exception":false,"start_time":"2024-03-25T21:39:37.895383","status":"completed"},"tags":[]},"source":["Executing various manipulations indicated by the comments. Notably, to simplify future manipulations, we have retained only the first genre for each movie, since movies in the existing data set had multiple genres separated by commas."]},{"cell_type":"code","execution_count":7,"id":"b39a099a","metadata":{"execution":{"iopub.execute_input":"2024-03-25T21:39:37.932108Z","iopub.status.busy":"2024-03-25T21:39:37.93052Z","iopub.status.idle":"2024-03-25T21:39:38.372835Z","shell.execute_reply":"2024-03-25T21:39:38.370787Z"},"papermill":{"duration":0.459439,"end_time":"2024-03-25T21:39:38.376831","exception":false,"start_time":"2024-03-25T21:39:37.917392","status":"completed"},"tags":[]},"outputs":[],"source":["# Removing movies with budget, revenue, vote average, and vote count zero\n","\n","movies_filtered <- filter(movies, revenue > 0, budget > 0, vote_average >0, vote_count > 0)\n","\n","# Leave just gender names\n","movies_filtered <- movies_filtered %>%\n","  mutate(genres = str_extract_all(genres, \"\\\\b[A-Z]\\\\w*\\\\b\") %>% lapply(toString))\n","\n","# Leave just production company names\n","movies_filtered <- movies_filtered %>%\n","  mutate(production_companies = str_extract(production_companies,\"\\\\b[A-Z]\\\\w*\\\\b\") %>% lapply(toString))\n","\n","# Remove Fiction since we now have Science & Fiction separately\n","movies_filtered <- movies_filtered %>%\n","  mutate(genres = str_remove(genres, \"Fiction, \"))\n","\n","# Add Fiction to Science\n","movies_filtered <- movies_filtered %>%\n","  mutate(genres = str_replace(genres, \"Science\", \"Science Fiction\"))\n","\n","# Split genres by comma, and leave just first string (genre) for easier analysis later on.\n","\n","movies_filtered <-movies_filtered %>% \n","  mutate(genres = str_split(genres, \", \", simplify = T)[, 1])"]},{"cell_type":"markdown","id":"78a28c0e","metadata":{"papermill":{"duration":0.011179,"end_time":"2024-03-25T21:39:38.399208","exception":false,"start_time":"2024-03-25T21:39:38.388029","status":"completed"},"tags":[]},"source":["In the following code, doing aesthetic changes to data - reordering, removing, renaming and etc."]},{"cell_type":"code","execution_count":8,"id":"690870a3","metadata":{"execution":{"iopub.execute_input":"2024-03-25T21:39:38.429657Z","iopub.status.busy":"2024-03-25T21:39:38.426891Z","iopub.status.idle":"2024-03-25T21:39:38.52871Z","shell.execute_reply":"2024-03-25T21:39:38.52634Z"},"papermill":{"duration":0.121439,"end_time":"2024-03-25T21:39:38.532581","exception":false,"start_time":"2024-03-25T21:39:38.411142","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 13</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>title</th><th scope=col>genre</th><th scope=col>production_companies</th><th scope=col>original_language</th><th scope=col>release_date</th><th scope=col>popularity</th><th scope=col>runtime</th><th scope=col>budget</th><th scope=col>revenue</th><th scope=col>vote_average</th><th scope=col>vote_count</th><th scope=col>m_id</th><th scope=col>imdb_id</th></tr>\n","\t<tr><th></th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;list&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;date&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt