vvMEIQAAAI0mVr110by5f393\nWdGm4mhW3gHtuxzf58ROrTIau67GYTUAAICGISAEAAAAAACAJJLS2AUAAAAAAAAADUdACAAA\nAAAAAElEQAgAAAAAAABJREAIAAAAAAAASURACAAAAAAAAElEQAgAAAAAAABJREAIAAAAAAAA\nSURACAAAAAAAAElEQAgAAAAAAABJ5P8BxnpCeWG0DvUAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":600,"width":1200}},"output_type":"display_data"}],"source":["# Vote_average vs Revenue \n","\n","ggplot(genre_financials, aes(x=avg_rating, y=avg_revenue)) + \n","  geom_point() + \n","  ggrepel::geom_text_repel(aes(label = genre), size=6) +\n","  theme(axis.text=element_text(size=14),\n","        axis.title=element_text(size=16,face=\"bold\"))"]},{"cell_type":"markdown","id":"f95b743d","metadata":{"papermill":{"duration":0.042087,"end_time":"2024-03-25T21:39:52.243884","exception":false,"start_time":"2024-03-25T21:39:52.201797","status":"completed"},"tags":[]},"source":["# Conclusion\n","\n","*Act Phase*\n","\n","![](https://s.yimg.com/os/creatr-uploaded-images/2020-06/f1fdd6b0-a3ee-11ea-9def-6ffa1e08d1d5)\n","\n","The analysis reveals that highly-rated genres such as Western, Documentary, History, Drama, and War do not necessarily translate into the highest profits. Furthermore, there appears to be a disconnect between the average votes and total number of votes, particularly evident in genres like Action where higher total votes don't guarantee higher ratings.\n","\n","On the other hand, genres like Family, Animation, Adventure, Science Fiction, and Fantasy emerge as the most profitable, boasting not only the highest average revenue but also substantial budgets. It's evident that a high average rating doesn't guarantee success in terms of revenue or profit, as seen in the case of Drama which, despite its solid ratings and large number of movies, lags behind in terms of revenue, profit, and ROI.\n","\n","The analysis highlights that the safest investments in movies were found in Animation, Family, and Horror genres. Although Horror films had lower budgets compared to Animation and Family, they still generated considerable profits. Conversely, genres like History and Westerns performed notably poorer in comparison."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3405,"sourceId":6663,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":22.119817,"end_time":"2024-03-25T21:39:52.408058","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-03-25T21:39:30.288241","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}